create table old_students (old_roll_no varchar2(20) not null, studentid varchar2(20)  primary key, fullname varchar2(100) not null);
create table current_students (current_roll_no varchar2(20) not null, studentid varchar2(20)  primary key, fullname varchar2(100) not null);
delete from old_students;
delete from current_students;
select * from old_students;
select * from current_students;
select o.studentid as studentid, o.fullname as old_name, c.fullname as current_name, o.old_roll_no as old_roll_no, c.current_roll_no as current_roll_no  from old_students o, current_students c where o.studentid = c.studentid order by old_roll_no;

